import React from "react";
import "./card.css";

export const Card = ({ name, image, attack, id, Types }) => {
  return (
    <div className="container">
      <figure className={Types[0].name && Types[1].name ? Types[1].name : null}>
        <div className="cardImageContainer">
          <img src={image} alt="" className="CardImage" />
        </div>
      <figcaption className="cardCaption">
        <h1 className="cardName">#{id} - {name}</h1>
          {Types.length >= 2 ? (
              <div className="types">
                <h3 className="cardType">{Types[0].name}</h3>
                <h3 className="cardType">{Types[1].name}</h3>
              </div>
            ) : (
                  <div className="types">
                    <h3 className="cardType">{Types[0].name}</h3>
                  </div>
                )
          }
      </figcaption>
      <div>
        <h4>Attack: {attack}</h4>
      </div>
      </figure>
    </div>
  );
};
